import { Link } from "react-router-dom";
import "./Cart.css";

const CartButton = () => {
  return (
    <div class="button">
      <Link to="/checkout">
        <button class="add_to_cart">Add to Cart</button>
      </Link>
    </div>
  );
};

export default CartButton;
